class DefaultDataCreator extends Component {

	constructor () {
		super();
		this.state = {
			loading: false,
			loaded: false,
			progress: {
				current: 0,
				total: people.length
			}
		};

		this.loadData = this.loadData.bind(this);
	}

	render() {

		if (!this.state.loading && !this.state.loaded) {
			return (<div>
				<h1>Data importer</h1>
				<button onClick={this.loadData}>Load data</button>
			</div>);
		} else if (this.state.loading) {
			return (<div>
				<h1>Data importer</h1>
				<h4>Progress : {this.state.progress.current}/{this.state.progress.total}</h4>
			</div>);
		}
		return (<div>
			<h1>Data importer</h1>
			<h4>Data successfully imported</h4>
		</div>);
	}

	loadData() {

		this.setState({
			loading: true
		});

		people.forEach(p => {
			store.dispatch(ProfileActionCreator.register({
				name: p.name.first,
				gender: p.gender,
				interestedIn: p.gender === 'male' ? 'female' : 'male',
				type: 'single',
				birthday: p.dob,
				location: p.location.city,
				nationality: p.nat,
				pictureThumbnail: p.picture.thumbnail,
				pictureMedium: p.picture.medium,
				pictureLarge: p.picture.large

			}));
			this.setState({
				progress: {
					...this.state.progress,
					current:this.state.progress.current+1
				}
			});
		});

		this.setState({
			loading: false,
			loaded: true
		});
	}
}

export default DefaultDataCreator;





